import React from "react";


function Login() {

    return (

        <div className="home-right-con">

            <div className="content-home-right bold-light">

                <h1>Welcome back!</h1>

                <form >
                    <label className="bold-light label-Inputs" htmlFor="email">Email</label>
                </form>

            </div>






        </div>

    );


}

export default Login;
